describe('wnp-protobufjs | JEST', () => {
  it('when protobufjs is loaded directly internal references point to wnp-pbjs', () => {
    const wnp_pbjs = require('..');
    const pbjs = require('protobufjs');

    expect(pbjs.Root).toEqual(wnp_pbjs.Root);
    expect(pbjs.Namespace).toEqual(wnp_pbjs.Namespace);
  });

});
